import React from "react";
import {
  DashboardContainer,
  DashboardHeaders,
  ShowTeam,
  TeamHeading,
  TeamIcon,
  FilterContainer,
  FilterButton,
  FilterIcon,
  SearchContainer,
  SearchInput,
  SearchIcon,
} from "./Dashboard";
import pokeball from "../../assets/images/pokeball.png";

const Dashboard = () => {
  return (
    <DashboardContainer>
      <DashboardHeaders>
        <ShowTeam>
          <TeamHeading>Team</TeamHeading>
          <TeamIcon src={pokeball} />
        </ShowTeam>
        <FilterContainer>
          <FilterButton placeholder="show all filter..." />
          <FilterIcon />
        </FilterContainer>
        <SearchContainer>
          <SearchInput placeholder="show all filter..." />
          <SearchIcon />
        </SearchContainer>
      </DashboardHeaders>
    </DashboardContainer>
  );
};

export default Dashboard;
